import Home from 'next/Home'
import Nav from '../components/nav'

const Index= () => {
    return(
    <div>
        <Home>
        <link rel="stylesheet" type="text/css" href="public/css/style.css"/>
        </Home>
        <Nav/>
    </div>
    )
}
export default Index;
